window.bookSummaryJSON = "<p><b>I'm a feral omega with one rule: Never get attached; Never let anyone in.</b></p> <p>But five alphas are about to shatter everything I thought I knew—and this time, I can't blame it on my biology.</p> <p>The Ghosts are killers with fractured souls. Monsters in human skin. But somehow, they've become <i>my</i> monsters.</p> <p>Especially Wraith, the silent, scarred sentinel who sees me like no one else. And as I realize I'm starting to fall for him, I also realize something even more terrifying.</p> <p>I'm falling for them all.</p> <p>And now, as shadows gather on the horizon that still calls out to me and deadly secrets about this dystopian world come to light, I'm faced with an impossible choice.</p> <p>Do I cling to the freedom I've always craved and escape in the chaos? Or do I embrace the bonds that both confine and liberate me?</p> <p>One thing's certain. The Ghosts aren't letting me go without a fight.</p> <p>And I'm not sure I want them to.</p> <p>Psycho Pack <i>is the second book in the Ghost Alpha Unit series. These are not standalones and must be listened to in order.</i></p> <p><i>For mature listeners. A complete list of content warnings can be found on the author's website.</i></p>"; 
